import React from 'react';

const ButtonSearch = () => {
    return (
        <>
            <div className="row">
                <div className="col-md-7"></div>
                <div className="col-md-5">
                    <button className='btn btn-outline-primary'>Search</button>
                </div>
            </div>
        </>
    );
};

export default ButtonSearch;
